import { NavigationContainer } from '@react-navigation/native';
import { createStackNavigator } from '@react-navigation/stack';
import GreetingsScreen from './screens/GreetingsScreen';
import MainUnauthScreen from './screens/MainUnauthScreen';
import AuthScreen from './screens/AuthScreen';
import RegScreen from './screens/RegScreen';
import ForgotScreen from './screens/ForgotScreen';

const Stack = createStackNavigator();

const screens = [
  {
    name: 'Greetings',
    component: GreetingsScreen,
    options: {
      title: 'Welcome',
    },
  },
  {
    name: 'MainUnauth',
    component: MainUnauthScreen,
    options: {
      title: 'Main Unauthenticated Screen',
    },
  },
  {
    name: 'Auth',
    component: AuthScreen,
    options: {
      title: 'Authentication Screen',
    },
  },
  {
    name: 'Reg',
    component: RegScreen,
    options: {
      title: 'Registration Screen',
    },
  },
  {
    name: 'Forgot',
    component: ForgotScreen,
    options: {
      title: 'Forgot Password Screen',
    },
  },
];

export default function App() {
  return (
    <NavigationContainer>
      <Stack.Navigator >
        <Stack.Screen name="Greetings" component={GreetingsScreen} />
        <Stack.Screen name="MainUnauth" component={MainUnauthScreen} />
        <Stack.Screen name="Auth" component={AuthScreen} />
        <Stack.Screen name="Reg" component={RegScreen} />
        <Stack.Screen name="Forgot" component={ForgotScreen} />
      </Stack.Navigator>
    </NavigationContainer>
  );
}
